import React, { Component } from 'react'
import './styles.global.scss'
import NavbarLoggedIn from '../views/navbars/navbar_logged_in'

class About extends Component {

  render() {

    return (
      <>
            <header>
                <NavbarLoggedIn />
            </header>
            <section className="section">

            </section>
        </>
    )
  }
}

export default About
